c\\u793e\\u4f1a\\u7ed3\\u6784\\u3002\\n\\n### 3. **\\u94c1\\u5668\\u65f6\\u4ee3\\u7684\\u53d8\\u9769\\uff08\\u7ea6\\u516c\\u5143\\u524d1200\\u5e74\\uff09**\\n\\u94c1\\u5668\\u65f6\\u4ee3\\u7684\\u5230\\u6765\\uff0c\\u5e26\\u6765\\u4e86\\u6280\\u672f\\u548c\\u793e\\u4f1a\\u7684\\u5de8\\u5927\\u53d8\\u9769\\u3002\\u5728\\u5730\\u4e2d\\u6d77\\u5730\\u533a\\uff0c\\u8d6b\\u68af\\u5e1d\\u56fd\\uff08\\u4eca\\u571f\\u8033\\u5176\\u5730\\u533a\\uff09\\u7387\\u5148\\u638c\\u63e1\\u4e86\\u94c1\\u5668\\u5236\\u9020\\u6280\\u672f\\uff0c\\u8fd9\\u4f7f\\u5f97\\u4ed6\\u4eec\\u5728\\u519b\\u4e8b\\u548c\\u7ecf\\u6d4e\\u4e0a\\u5360\\u636e\\u4e86\\u4f18\\u52bf\\u3002\\u8d6b\\u68af\\u4eba\\u7684\\u94c1\\u5668\\u6280\\u672f\\u968f\\u540e\\u4f20\\u64ad\\u5230\\u6574\\u4e2a\\u53e4\\u4ee3\\u4e16\\u754c\\uff0c\\u63a8\\u52a8\\u4e86\\u94c1\\u5668\\u65f6\\u4ee3\\u7684\\u5168\\u9762\\u5230\\u6765\\u3002\\n\\n\\u5728\\u4e2d\\u56fd\\uff0c\\u5546\\u671d\\uff08\\u7ea6\\u516c\\u5143\\u524d1600-1046\\u5e74\\uff09\\u662f\\u9752\\u94dc\\u5668\\u6587\\u5316\\u7684\\u9f0e\\u76db\\u65f6\\u671f\\u3002\\u5546\\u671d\\u4eba\\u94f8\\u9020\\u4e86\\u7cbe\\u7f8e\\u7684\\u9752\\u94dc\\u5668\\uff0c\\u5982\\u53f8\\u6bcd\\u620a\\u9f0e\\uff0c\\u8fd9\\u4e9b\\u5668\\u7269\\u4e0d\\u4ec5\\u662f\\u796d\\u7940\\u7528\\u54c1\\uff0c\\u4e5f\\u662f\\u6743\\u529b\\u548c\\u5730\\u4f4d\\u7684\\u8c61\\u5f81\\u3002\\u5546\\u671d\\u7684\\u6587\\u5b57\\u2014\\u2014\\u7532\\u9aa8\\u6587\\uff0c\\u662f\\u4e2d\\u56fd\\u6700\\u65e9\\u7684\\u6587\\u5b57\\u7cfb\\u7edf\\uff0c\\u8bb0\\u5f55\\u4e86\\u5546\\u671d\\u7684\\u5386\\u53f2\\u548c\\u5360\\u535c\\u6d3b\\u52a8\\u3002\\n\\n### 4. **\\u53e4\\u5178\\u65f6\\u4ee3\\u7684\\u5174\\u8d77\\uff08\\u7ea6\\u516c\\u5143\\u524d800\\u5e74\\uff09**\\n\\u53e4\\u5178\\u65f6\\u4ee3\\u7684\\u5174\\u8d77\\uff0c\\u6807\\u5fd7\\u7740\\u4eba\\u7c7b\\u6587\\u660e\\u8fdb\\u5165\\u4e86\\u65b0\\u7684\\u9636\\u6bb5\\u3002\\u5728\\u5e0c\\u814a\\uff0c\\u96c5\\u5178\\u548c\\u65af\\u5df4\\u8fbe\\u6210\\u4e3a\\u4e86\\u4e