INSERT INTO `plugin` VALUES (7,'23ad369d-8d7b-4d6e-917d-91411a57a861','af4c804f-3966-4949-ace2-3bb7416ea926','图片生成文字','','图片生成文字','http://localhost:8005/api/v1/custom-plugin/image-2-text','{\"content_type\": \"application/json\", \"authorization\": \"\"}','{\"return_value_type\": \"Text\", \"parse_path\": [\"data\"]}','{\"image_url\": \"${user_request}\"}',1,'2025-02-27 22:11:53','2025-03-26 23:31:34'),(8,'75b73fcf-34dd-4f04-8b07-634f57ff093d','af4c804f-3966-4949-ace2-3bb7416ea926','md转图片','','md转图片','http://localhost:8005/api/v1/custom-plugin/markdown-2-image','{\"content_type\": \"application/json\", \"authorization\": \"\"}','{\"return_value_type\": \"Url\", \"parse_path\": [\"data\", \"url\"]}','{\"content\": \"${UserRequest}$\"}',1,'2025-03-01 15:00:23','2025-03-27 16:19:26'),(18,'0990ee66-73d4-4469-933e-3ce6fa95eae1','af4c804f-3966-4949-ace2-3bb7416ea926','科技人才画像智能体','','整合多渠道人才数据（如论文、专利、科研项目等），构建动态更新的科技人才数字档案，生成多维技术标签与能力评估模型，实现人才与科研项目、团队需求的精准匹配。可预警人才流动风险，并为人才引进、培训规划及激励政策制定提供数据支持，提升科技人才管理的科学性与效率。','http://192.168.1.138:8000/api/v1/sapper/agent/generate_answer/5915d9a3-9f55-4ab6-b5cb-80c2cf80a82c','{\"content_type\": \"application/json\", \"authorization\": \"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE3NzQ0OTQyMDMsInN1YiI6IjEifQ.M4B27ZmWLrZ4KY3TNnmFg5wssqNe8JpvxfG8Bxe45WA\"}','{\"return_value_type\": \"Text\", \"parse_path\": [\"content\"]}','{\"message\": \"${UserRequest}$\"}',3,'2025-03-30 23:57:47','2025-03-31 23:19:09'),(19,'e4d4a6df-266d-4d4d-b5e6-6ee51d948fb4','af4c804f-3966-4949-ace2-3bb7416ea926','地理老师刘备','','上知天文，下至地理，能够以幽默诙谐的语气讲述地理知识','http://192.168.1.138:8000/api/v1/sapper/agent/generate_answer/551d124b-1766-4fa5-823c-bf5076ec3f9e','{\"content_type\": \"application/json\", \"authorization\": \"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE3NzQ0OTQyMDMsInN1YiI6IjEifQ.M4B27ZmWLrZ4KY3TNnmFg5wssqNe8JpvxfG8Bxe45WA\"}','{\"return_value_type\": \"Text\", \"parse_path\": [\"content\"]}','{\"message\": \"${UserRequest}$\"}',3,'2025-03-31 12:29:46','2025-03-31 18:37:46'),(20,'b1d7e945-91c0-4a56-aa99-e094080ac00e','af4c804f-3966-4949-ace2-3bb7416ea926','英语阅读理解教师','','一位英语阅读理解教师，专注于帮助中学生提升阅读理解能力','http://192.168.1.138:8000/api/v1/sapper/agent/generate_answer/3c9239db-f5c2-4e8c-b484-3e829967e093','{\"content_type\": \"application/json\", \"authorization\": \"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE3NzQ0OTQyMDMsInN1YiI6IjEifQ.M4B27ZmWLrZ4KY3TNnmFg5wssqNe8JpvxfG8Bxe45WA\"}','{\"return_value_type\": \"Text\", \"parse_path\": [\"content\"]}','{\"message\": \"${UserRequest}$\"}',3,'2025-03-31 12:38:00','2025-03-31 20:25:43'),(21,'d29f4817-b67d-4933-bec4-1b4c62e54f5e','af4c804f-3966-4949-ace2-3bb7416ea926','科技人才处人才推荐助手','','为省级科技项目提供专家智能匹配服务，根据项目领域、专家资质等需求条件，自动筛选符合条件的领域专家。支持设置硬性条件（如项目经验、专利匹配度）和优先条件（如科技奖励），自动规避利益冲突，生成推荐名单。','http://192.168.1.138:8000/api/v1/sapper/agent/generate_answer/7a7396e7-c0a6-4cd9-b9b1-0f20ebb2b0bb','{\"content_type\": \"application/json\", \"authorization\": \"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE3NzQ0OTQyMDMsInN1YiI6IjEifQ.M4B27ZmWLrZ4KY3TNnmFg5wssqNe8JpvxfG8Bxe45WA\"}','{\"return_value_type\": \"Text\", \"parse_path\": [\"content\"]}','{\"message\": \"${UserRequest}$\"}',3,'2025-03-31 15:16:22','2025-04-01 00:26:47'),(22,'5359b0d4-96a5-4b84-a7f4-1503cfef5f37','af4c804f-3966-4949-ace2-3bb7416ea926','监安处计划书分析员','','负责项目计划书的形式审查与数据提取，自动核验文档完整性（含签章、目录等要素），精准提取技术方案、预算明细等关键信息并结构化，可识别常见格式问题（如预算表缺失明细说明），输出标准化数据供后续分析使用','http://192.168.1.138:8000/api/v1/sapper/agent/generate_answer/959480e6-a35c-449f-81ee-4b13595fdc9b','{\"content_type\": \"application/json\", \"authorization\": \"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE3NzQ0OTQyMDMsInN1YiI6IjEifQ.M4B27ZmWLrZ4KY3TNnmFg5wssqNe8JpvxfG8Bxe45WA\"}','{\"return_value_type\": \"Text\", \"parse_path\": [\"content\"]}','{\"message\": \"${UserRequest}$\"}',3,'2025-03-31 15:23:46','2025-04-01 00:29:07'),(23,'0ec2425b-95cf-46e8-92e9-8a02c72a13cb','af4c804f-3966-4949-ace2-3bb7416ea926','前沿技术处技术可行性分析员','','焦